import React from "react";
import wave from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/waving-hand.png";
import flag_ca from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/flag-canada_.png";
import heart from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/heart.png";
import CommonParent from "./CommonParent";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/spaceship.gif";
const Home = (props) => {
  return (
    <div id="home" className=" #home">
      <CommonParent
        name={
          <p>
            Hello! <img height="30" width="30" src={wave} /> <br /> I'm Maah
            Asghar. <br />
          </p>
        }
        text={
          <p>
            I am a <br />
            Software Engineer and Illustrator{" "}
            <img height="31" width="32" src={heart} />
            <br /> based in <br />
            London, Ontario, Canada <img height="25" width="25" src={flag_ca} />
          </p>
        }
        imgsrc={web}
        visit="/#projects"
        btname="View Projects"
      />

      {/* <CommonParent
        name="Hello! my name is "
        imgsrc={web}
        visit="/projects"
        btname="View Projects"
      /> */}
    </div>
  );
};

export default Home;
